import { EachProduct } from "./EachProduct"

export const Goods = () => {
    return (
        <div>
            <h1>ALL THE GOODS are here</h1>
            {dataGoods.map(eachProduct => { 
            <EachProduct eachProduct={eachProduct}/> })}

        </div>
    )
}
